- input: "TEXT\x1CC00463414\x1C.TEXT\x1C\x1CF3A\x1CThe difference in the reported
    amount from the previous filing to the ammended filing was due to an error uploading
    the data into FECfile. We we unaware that reloading the information from excel
    would not overwrite the information already in FECfile. We submitted this file
    with a very large number of duplicated entries. That was the reason we ammended
    the file; we noticed the error and wanted to make sure the reporting was corrected.
    We had problems with file formats and getting data to import every time we filed,
    so we uploaded the incorrect information without being abel to tell if the data
    was correct. The website showed the incorrect amount when we went online to verify
    this. \n"
